import React from 'react';

import './App.css';

function App() {

const pStyle1 = {
    textAlign: 'center',
    fontSize: '100px'
}

return (
    <div className="App">
        <header className="App-header">
            <p style={pStyle1}>WELCOME</p>
            <p>I'm an undergraduate</p>
            <p>I'm a Software Engineer</p>
            <p>I'M ALLEN ZHAI</p>
        </header>
    </div>
  );
}

export default App;
